import React from "react";

type AddressProps = {
  street: string;
  suite: string;
  city: string;
  zipcode: string;
  geo: {
    lat: string;
    lng: string;
  };
};

type CompanyProps = {
	name: string;
}

export type UserProps = {
  name: string;
  username: string;
  email: string;
  address: AddressProps;
  phone: string;
  website: string;
  company: CompanyProps;
};

const User = ({ name }: UserProps) => {
  return <div>{name}</div>;
};

export default User;
